---@diagnostic disable: lowercase-global
local d1 = 30000
local d2 = 90000
local d3 = 234
local delay = d1
local last = 0
local frame = 1

function init()
---@diagnostic disable-next-line: param-type-mismatch
  frame = tonumber(self.tag, 10)
  if frame == nil then frame = 1 end
  if self.parent.tag == 'found' then
    d2 = 5000
  end
  delay = d1
  self.parent.visible = false
  curtain(true)
end

function onValueChanged(k)
  if k == 'touch' and not self.values.touch then
    self.parent.visible = false
    self.parent.tag = 'found'
    self.parent.parent.children.logo.visible = true
  end
end

function isPaused()
  return (
    not (self.parent.parent.children.logo.visible or self.parent.visible) or
    (self.parent.parent.children.logo.visible and self.parent.tag == 'found')
  )
end

function curtain(b)
  if b then
    self.parent.children.curtain:setValueField('x', ValueField.DEFAULT, 1)
    self.parent.children.curtain.values.x = 1
  else
    self.parent.children.curtain:setValueField('x', ValueField.DEFAULT, 0)
  end
end

function update()
  local now = getMillis()
  if now - last < delay then return end
  if isPaused() then
    self.parent.visible = false
    curtain(true)
    delay = d1 --when paused, check every 30 seconds
    last = now
    return
  end
  if delay == d1 then
    delay = self.parent.tag == 'found' and d3 or d2
    last = now
    return
  end
  if delay == d2 or delay == d3 then
    -- start again after pause or film ended
    self.parent.visible = true
    self.parent.parent.children.logo.visible = false
    curtain(false)
    delay = 100
    last = now
    return
  end
  if frames[frame] == nil then
    -- The End..
    frame = 1
    delay = d1
    curtain(true)
  else
    self.values.text = '\n' .. frames[frame].frame
    delay = frames[frame].length * 100
    frame = frame + 1
  end
  self.tag = frame
  last = now
end

